<!doctype html>
<html lang="ar" dir="rtl">
<head>
<meta charset="utf-8" />
<meta name="viewport" content="width=device-width,initial-scale=1" />
<title>AM</title>
<style>
:root{
  --bg:#f3f5fb; --ink:#0f172a; --muted:#64748b; --card:#fff; --line:#e2e8f0;
  --shadow:0 18px 45px rgba(2,6,23,.12);
  --ok:#22c55e; --mid:#f59e0b; --low:#ef4444;
  --accent:#2563eb; --orange:#fb923c;
}
*{box-sizing:border-box}
body{margin:0;padding:18px;background:radial-gradient(circle at 20% 20%,#fff 0%,var(--bg) 42%,#eaf0ff 100%);
  font-family:system-ui,-apple-system,"Tajawal",Arial;color:var(--ink)}
.panel{max-width:1100px;margin:auto;background:var(--card);border:1px solid var(--line);
  border-radius:20px;box-shadow:var(--shadow);padding:16px}
h1{margin:0 0 8px;font-size:18px}
.sub{margin:0 0 14px;color:var(--muted);font-size:13px;line-height:1.5}
.btn{border:0;border-radius:14px;padding:10px 12px;cursor:pointer;font:inherit}
.btn.dark{background:#0f172a;color:#fff}
.btn.orange{background:var(--orange);color:#111827}
.tag{background:rgba(255,255,255,.8);border:1px solid rgba(0,0,0,.10);padding:6px 10px;border-radius:999px;font-size:12px;display:flex;gap:8px;align-items:center;width:fit-content}
.radio{
  margin-top:10px;
  background: linear-gradient(180deg, rgba(255,255,255,.28), rgba(255,255,255,0) 35%),
              radial-gradient(circle at 30% 20%, rgba(255,255,255,.40), transparent 55%),
              linear-gradient(135deg, #8a5a34 0%, #6e4527 45%, #5b371f 100%);
  border:1px solid rgba(0,0,0,.18);
  border-radius:22px;
  box-shadow:0 22px 55px rgba(2,6,23,.18), inset 0 2px 0 rgba(255,255,255,.25), inset 0 -10px 30px rgba(0,0,0,.18);
  padding:16px;
}
.topbar{display:flex;justify-content:space-between;align-items:center;gap:12px;flex-wrap:wrap}
.display{
  min-width:260px;padding:10px 12px;border-radius:14px;background:linear-gradient(180deg,#111827 0%,#0b1220 100%);
  border:1px solid rgba(255,255,255,.10); box-shadow: inset 0 1px 0 rgba(255,255,255,.08), 0 10px 22px rgba(0,0,0,.22);
  color:#e5e7eb; display:flex; align-items:center; gap:12px
}
.display-label{font-weight:800;letter-spacing:.12em;font-size:12px;opacity:.9;padding:6px 10px;border-radius:999px;background:rgba(255,255,255,.08);border:1px solid rgba(255,255,255,.10)}
.display-name{font-weight:900;font-size:15px;flex:1;color:#fef3c7;white-space:nowrap;overflow:hidden;text-overflow:ellipsis}
.dial{margin-top:12px;background:rgba(245,247,250,.92);border:1px solid rgba(0,0,0,.14);border-radius:18px;padding:12px}
.dialHead{display:flex;justify-content:space-between;align-items:center;gap:10px;flex-wrap:wrap;font-size:13px}
.scaleWrap{margin-top:10px;position:relative;padding:8px 10px 12px;border-radius:14px;background:linear-gradient(180deg, rgba(255,255,255,.98), rgba(255,255,255,.88));
  border:1px solid rgba(0,0,0,.14); box-shadow: inset 0 2px 10px rgba(0,0,0,.10);}
.scaleTop{display:flex;justify-content:space-between;font-size:11px;color:#334155;opacity:.9;margin-bottom:6px}
input[type="range"]{width:100%}
.needle{position:absolute;top:36px;height:28px;width:4px;background:#ef4444;border-radius:3px;transform:translateX(-50%);
  box-shadow:0 0 0 2px rgba(255,255,255,.75);pointer-events:none}
.midRow{display:grid;grid-template-columns:1.1fr .9fr;gap:12px;margin-top:12px}
.speaker{background:rgba(0,0,0,.08);border:1px solid rgba(0,0,0,.18);border-radius:18px;padding:12px;display:flex;align-items:center;gap:12px}
.grill{width:110px;height:110px;border-radius:999px;background:
  radial-gradient(circle at 50% 50%, rgba(0,0,0,.20), transparent 62%),
  repeating-radial-gradient(circle at 50% 50%, rgba(0,0,0,.28) 0 2px, transparent 2px 8px);
  border:1px solid rgba(0,0,0,.18);box-shadow: inset 0 0 0 6px rgba(255,255,255,.06)}
.box{background:rgba(255,255,255,.78);border:1px solid rgba(0,0,0,.10);border-radius:14px;padding:10px}
.row{display:flex;justify-content:space-between;align-items:center;gap:10px;font-size:12px}
.leds{display:flex;gap:8px;align-items:center}
.led{width:10px;height:10px;border-radius:999px;background:#cbd5e1;box-shadow: inset 0 0 0 1px rgba(0,0,0,.12)}
.led.ok.on{background:var(--ok)} .led.mid.on{background:var(--mid)} .led.low.on{background:var(--low)}
label{display:block;font-size:12px;color:#334155;margin:10px 0 6px}
select,input[type="text"]{width:100%;padding:10px 12px;border-radius:14px;border:1px solid rgba(0,0,0,.10);background:rgba(255,255,255,.92);font:inherit}
.grid2{display:grid;grid-template-columns:1fr 1fr;gap:10px}
@media (max-width:980px){.midRow{grid-template-columns:1fr}}
</style>
</head>
<body>
<div class="panel">
  <h1>AM — راديو تفاعلي</h1>
  <p class="sub">هذه نسخة “مضمونة” لأنها تدمج الصوتين داخل الصفحة نفسها (بدون ملفات خارجية)، وتعرض فقط بيانات المحطة المختارة.</p>

  <div class="radio">
    <div class="topbar">
      <div class="tag"><span>الحالة:</span><b id="state">مطفأ</b></div>
      <div class="display"><div class="display-label">AM</div><div class="display-name" id="nowPlaying"></div></div>
      <div style="display:flex;gap:10px;flex-wrap:wrap">
        <button class="btn dark" id="power">تشغيل</button>
      </div>
    </div>

    <div class="dial">
      <div class="dialHead">
        <div>تردد الإذاعة المختارة (kHz): <b id="chosenFreq">—</b></div>
        <div class="tag">قوة الإشارة: <b id="strength">—</b></div>
      </div>

      <div class="scaleWrap" id="scaleWrap">
        <div class="scaleTop"><span>540</span><span>700</span><span>900</span><span>1100</span><span>1300</span><span>1500</span><span>1690</span></div>
        <div class="needle" id="needle"></div>
        <input id="freq" type="range" min="540" max="1690" step="1" value="800" />
      </div>

      <div class="midRow">
        <div class="speaker">
          <div class="grill"></div>
          <div style="flex:1;display:grid;gap:10px">
            <div class="box">
              <div class="row">
                <span>لمبات الإشارة</span>
                <div class="leds">
                  <div class="led ok" id="ledOk"></div>
                  <div class="led mid" id="ledMid"></div>
                  <div class="led low" id="ledLow"></div>
                </div>
              </div>
            </div>
            <div class="box">
              <div class="row"><span>الصوت</span><b id="volLabel">60%</b></div>
              <input id="vol" type="range" min="0" max="100" step="1" value="60" />
            </div>
          </div>
        </div>

        <div class="box">
          <div class="grid2">
            <div><label>مكاني</label><select id="rxCity"></select></div>
            <div><label>مكان البث</label><input id="txCity" type="text" readonly /></div>
          </div>
          <div class="grid2">
            <div><label>البعد (km)</label><input id="dist" type="text" readonly /></div>
            <div><label>ملاحظات</label><input id="note" type="text" placeholder="اختياري" /></div>
          </div>
          <div class="sub" style="margin-top:8px">
            المحطات: القرآن (793 kHz) — هنا القاهرة (1078 kHz)
          </div>
        </div>
      </div>
    </div>
  </div>

<script>
const $ = (id)=>document.getElementById(id);

const ST1_NAME = "إذاعة القرآن الكريم";
const ST2_NAME = "هنا القاهرة";
const ST1_FREQ = 793;
const ST2_FREQ = 1078;

// Cities (rx only)
const CITIES = ["الرياض","جدة","مكة","المدينة","الدمام","أبها","بيشة","القاهرة"];

// Distance overrides requested
const overrides = {
  "الرياض|بيشة": 927,
  "بيشة|الرياض": 927,
  "بيشة|القاهرة": 2011,
  "القاهرة|بيشة": 2011,
};

function fillRx(){
  CITIES.forEach(n=>{
    const o=document.createElement("option");
    o.value=n; o.textContent=n;
    $("rxCity").appendChild(o);
  });
  $("rxCity").value="بيشة";
}

function clamp01(x){return Math.max(0, Math.min(1, x));}
function quality(khz, stationKhz){
  const df = Math.abs(khz - stationKhz);
  return clamp01(1 - (df/220));
}
function strengthLabel(q){
  if(q>=0.72) return "قوية";
  if(q>=0.35) return "متوسطة";
  return "ضعيفة";
}
function setLED(level){
  $("ledOk").classList.remove("on","ok");
  $("ledMid").classList.remove("on","mid");
  $("ledLow").classList.remove("on","low");
  if(level==="قوية") $("ledOk").classList.add("on","ok");
  else if(level==="متوسطة") $("ledMid").classList.add("on","mid");
  else $("ledLow").classList.add("on","low");
}

function updateNeedle(){
  const wrap = $("scaleWrap").getBoundingClientRect();
  const min=540, max=1690;
  const khz = Number($("freq").value);
  const t = (khz - min) / (max - min);
  const x = 10 + t * (wrap.width - 20);
  $("needle").style.left = `${x}px`;
}

const a1=$("a1"), a2=$("a2");
let running=false;

async function safePlay(el){try{await el.play();}catch(e){}}

function applyAudio(pick, q, hasStation){
  const vol = Number($("vol").value)/100;
  $("volLabel").textContent = `${Math.round(vol*100)}%`;

  // Ensure both started (Safari), then hard-mute the non-selected track
  if(running){ safePlay(a1); safePlay(a2); }

  const base = running && hasStation ? (vol * (0.95*q)) : 0;

  const sel1 = (pick===1) && base>0;
  const sel2 = (pick===2) && base>0;

  a1.muted = !sel1;
  a2.muted = !sel2;

  a1.volume = sel1 ? base : 0;
  a2.volume = sel2 ? base : 0;

  if(!running){
    a1.muted=true; a2.muted=true;
    a1.volume=0; a2.volume=0;
    a1.pause(); a2.pause();
    a1.currentTime=0; a2.currentTime=0;
  }
}

function refresh(){
  const khz = Number($("freq").value);

  const q1 = quality(khz, ST1_FREQ);
  const q2 = quality(khz, ST2_FREQ);
  const pick = (q1>=q2) ? 1 : 2;
  const q = (pick===1) ? q1 : q2;
  const hasStation = q > 0.10;

  const level = strengthLabel(q);
  $("strength").textContent = level;
  setLED(level);

  // Show ONLY selected station info
  if(running && hasStation){
    $("nowPlaying").textContent = (pick===1) ? ST1_NAME : ST2_NAME;
    $("chosenFreq").textContent = (pick===1) ? String(ST1_FREQ) : String(ST2_FREQ);
    $("txCity").value = (pick===1) ? "الرياض" : "القاهرة";
  } else {
    $("nowPlaying").textContent = "";
    $("chosenFreq").textContent = "—";
    $("txCity").value = "";
  }

  // Distance (override first)
  const tx = $("txCity").value;
  const rx = $("rxCity").value;
  const key = `${tx}|${rx}`;
  const d = overrides[key];
  $("dist").value = (d!==undefined) ? String(d) : "";

  applyAudio(pick, q, hasStation);
  updateNeedle();
}

$("freq").addEventListener("input", refresh);
$("vol").addEventListener("input", refresh);
$("rxCity").addEventListener("change", refresh);
window.addEventListener("resize", updateNeedle);

$("power").addEventListener("click", async ()=>{
  running = !running;
  $("state").textContent = running ? "يعمل" : "مطفأ";
  $("power").textContent = running ? "إيقاف" : "تشغيل";
  if(running){ await safePlay(a1); await safePlay(a2); }
  refresh();
});

fillRx();
updateNeedle();
refresh();
</script>
